import logo from "./logo.svg";
import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import {
    Container,
    InputGroup,
    FormControl,
    Button,
    Row,
    Card,
} from "react-bootstrap";

function App() {
    return (
        <div className="App">
            <Container>
                <InputGroup className="mb-3" size="lg"></InputGroup>
            </Container>
        </div>
    );
}

export default App;
